/**
 * Area where users can preview their links
 *
 * @copyright 2021 Beacons - All rights reserved
 */

 import './styles/links_preview.scss';

 function LinksPreview() {
  const linksData = [
    {
      id: 1,
      url: '#',
      title: 'Link 1',
      clicks: 4
    },
    {
      id: 2,
      url: '#',
      title: 'Link 2',
      clicks: 32
    }
  ];

   return (
     <div className="links-preview-container">
       Links preview
     </div>
   );
 }

 export default LinksPreview;
